import { combineReducers } from 'redux';
import { processCoinSaga, processCoin } from './coinReducer';
import { all } from 'redux-saga/effects';

const rootReducer = combineReducers({
    processCoin
});


function* rootSaga() {
    yield all([processCoinSaga()]);
}
export {
    rootReducer,
    rootSaga,
};
